import React from 'react';
import { CSSTransition } from 'react-transition-group';
import './VisualComponents.css';

export function Node(props) {
  return (
    <CSSTransition
      in={props.highlight}
      classNames="t"
      timeout={3000}
    >
      <div className="node">
        {props.children}
      </div>
    </CSSTransition>
  );
}
